import meals from "../../../assets/meals.jpeg";
import classes from "./Header.module.css";

const Header = () => {
  return (
    <>
      <header className={classes.header}>
        <h1>React Meals</h1>
        <button>Cart</button>
      </header>
      <div className={classes['main-image']}>
        <img src={meals} alt="meals img" />
      </div>
    </>
  );
};

export default Header;
